  `addtime` varchar(20) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '申请时间',
  `msg` varchar(255) DEFAULT '' COMMENT '审核描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

