-- ----------------------------
--  Table structure for `d_feedback`
-- ----------------------------
DROP TABLE IF EXISTS `d_feedback`;
CREATE TABLE `d_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content` varchar(256) NOT NULL DEFAULT '',
  `feedback_time` datetime NOT NULL,
  `user_id` int(11) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `d_game_mj_log`
-- ----------------------------
DROP TABLE IF EXISTS `d_game_mj_log`;
CREATE TABLE `d_game_mj_log` (
  `id` bigint(21) NOT NULL AUTO_INCREMENT,
  `gameid` bigint(21) DEFAULT NULL COMMENT '房间游戏id',
  `round` int(11) DEFAULT '0' COMMENT '第几局',
  `step` int(11) DEFAULT '0' COMMENT '步骤（0：刚创建，1：定庄家，2：发牌，3：补花，4：开金，5：当前玩家（摸牌、吃碰杠者）操作，6：等待其他玩家操作，7：本局结束（结算），20：房间游戏结束（结算））',
  `uid` int(11) DEFAULT '0' COMMENT '操作玩家（0：系统，>0玩家id）',
  `operate` int(11) DEFAULT '0' COMMENT '操作（-1：无操作，0：等待，1：出牌，2：吃，3：碰，4：暗杠，5：明杠，6：胡，8：杠）',
  `substep` int(11) DEFAULT '0' COMMENT '从庄家出牌开始，玩家的操作的步骤数（0：还未到玩家操作，>1步骤数）',
  `describe` varchar(50) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '描述',
  `info` text CHARACTER SET utf8mb4,
  `addtime` varchar(30) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8141 DEFAULT CHARSET=utf8;

