DROP TABLE IF EXISTS `d_loginlog`;
CREATE TABLE `d_loginlog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bg_userid` int(11) DEFAULT '0' COMMENT '后台用户id',
  `operatetype` int(11) DEFAULT '0' COMMENT '操作类型（0：登录，1：登出）',
  `operatetime` varchar(30) DEFAULT NULL COMMENT '操作时间',
  `operateip` varchar(50) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '操作IP',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8;

