-- ----------------------------
--  Table structure for `d_msg`
-- ----------------------------
DROP TABLE IF EXISTS `d_msg`;
CREATE TABLE `d_msg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content` varchar(1024) NOT NULL DEFAULT '',
  `msg_time` datetime NOT NULL,
  `uid` int(11) NOT NULL,
  `msg_status` int(11) NOT NULL DEFAULT '0' COMMENT '0未知1未读2已读3删除',
  `msg_type` int(11) NOT NULL DEFAULT '0' COMMENT '0个人消息1购买消息',
  `is_send` int(2) NOT NULL DEFAULT '0' COMMENT '是否发放奖励 0 否 1 是',
  `coin` float(11,2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1852 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `d_order`
-- ----------------------------
DROP TABLE IF EXISTS `d_order`;
CREATE TABLE `d_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `item_id` int(11) NOT NULL DEFAULT '0',
  `order_time` datetime NOT NULL,
  `update_time` datetime DEFAULT NULL,
  `user_id` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `price` int(11) NOT NULL DEFAULT '0',
  `money` int(11) NOT NULL DEFAULT '0',
  `appid` varchar(56) NOT NULL DEFAULT '',
  `original_transaction_id` varchar(64) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=274 DEFAULT CHARSET=utf8;

