-- ----------------------------
--  Table structure for `d_trade`
-- ----------------------------
DROP TABLE IF EXISTS `d_trade`;
CREATE TABLE `d_trade` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` int(11) NOT NULL,
  `mobile` varchar(12) NOT NULL,
  `address` varchar(256) NOT NULL,
  `name` varchar(64) NOT NULL DEFAULT '',
  `trade_id` int(11) NOT NULL,
  `trade_time` datetime NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `d_user`
-- ----------------------------
DROP TABLE IF EXISTS `d_user`;
CREATE TABLE `d_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deviceid` varchar(64) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `device_name` varchar(64) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `user_name` varchar(64) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `user_avatar` varchar(256) CHARACTER SET utf8 DEFAULT '',
  `user_sex` tinyint(4) NOT NULL DEFAULT '0',
  `last_logintime` int(11) DEFAULT '0',
  `register_time` int(11) DEFAULT '0',
  `from_platform` varchar(16) CHARACTER SET utf8 DEFAULT 'pc',
  `user_status` int(11) DEFAULT '0' COMMENT '0正常1禁用',
  `user_coin` int(11) DEFAULT '0' COMMENT '用户金币',
  `user_money` int(11) DEFAULT '0' COMMENT '用户房卡',
  `user_point` int(11) DEFAULT '0' COMMENT '玩家积分',
  `bg_userid` int(11) DEFAULT '0' COMMENT '后台管理员或者代理商id（默认为0，是普通玩家）',
  `agentid` int(11) DEFAULT '0' COMMENT '代理id',
  `lottery_time` int(11) DEFAULT '0' COMMENT '最后抽奖时间',
  `__version` int(11) NOT NULL DEFAULT '0' COMMENT '版本号，用于防止异步数据',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=100060 DEFAULT CHARSET=latin1;

