-- ----------------------------
--  Table structure for `d_user_log`
-- ----------------------------
DROP TABLE IF EXISTS `d_user_log`;
CREATE TABLE `d_user_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `type` int(11) DEFAULT '0' COMMENT '操作类型（1：更新钻石，2：更新金币，3：更新积分，10：禁用、启用玩家，90：设置为一级代理商，80：设置为二级代理商，100：设置为管理员，20：设置为普通玩家）',
  `operate_userid` int(11) DEFAULT '0' COMMENT '操作者用户ID',
  `user_id` int(11) DEFAULT '0' COMMENT '被操作的用户ID',
  `add_number` int(11) DEFAULT '0' COMMENT '增加数量',
  `start_number` int(11) DEFAULT '0' COMMENT '操作前数量',
  `end_number` int(11) DEFAULT '0' COMMENT '操作后数量',
  `result` int(11) DEFAULT '0' COMMENT '0执行失败；>0执行成功；',
  `addtime` int(11) DEFAULT '0' COMMENT '操作时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4;

