--  Table structure for `t_ct_hb_action`
-- ----------------------------
DROP TABLE IF EXISTS `t_ct_hb_action`;
CREATE TABLE `t_ct_hb_action` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `room_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '房间号',
  `round_id` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '局数ID',
  `round_num` int(6) NOT NULL DEFAULT '0' COMMENT '局数',
  `time` bigint(20) NOT NULL DEFAULT '0' COMMENT '操作时间',
  `baner_id` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '庄家id',
  `step` int(2) NOT NULL DEFAULT '0' COMMENT '步骤',
  `uid` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '用户id',
  `name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '用户名字',
  `avatar` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '用户头像',
  `rob_value` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '抢庄金额',
  `bet_type` int(1) NOT NULL DEFAULT '0' COMMENT '下注类型',
  `bet_sub_types` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '下注子类型List',
  `bet_values` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '下注金额List',
  `packers` varchar(20480) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '生产红包数据',
  `packet_value` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '红包金额',
  `packet_open` int(1) NOT NULL DEFAULT '0' COMMENT '红包状态',
  `point_type` int(1) NOT NULL DEFAULT '0' COMMENT '点数类型',
  `point_name` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '点数名字',
  `rate` int(2) NOT NULL DEFAULT '0' COMMENT '倍数',
  `point_types` int(20) NOT NULL DEFAULT '0' COMMENT '点数类型List',
  `point_names` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '点数名字List',
  `d_point_types` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '大小单双类型&点数List',
  `d_point_names` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '大小单双类型&点数名List',
  `d_rates` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '倍数List',
  `d_point_get_moneys` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '大小单双类型&点数名每个注输赢情况List',
  `get_money` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '赢的钱',
  `info` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '播报信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3351 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ----------------------------
--  Table structure for `t_ct_hb_daily_rebate`
-- ----------------------------
DROP TABLE IF EXISTS `t_ct_hb_daily_rebate`;
CREATE TABLE `t_ct_hb_daily_rebate` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `room_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '房间id',
  `round_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '局数id',
  `round_num` int(6) NOT NULL DEFAULT '0' COMMENT '局数',
  `uid` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '用户id',
  `name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '名字',
  `avatar` varchar(128) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '头像',
  `time` bigint(20) NOT NULL DEFAULT '0' COMMENT '操作时间',
  `coin_change` float(20,2) NOT NULL DEFAULT '0.00' COMMENT '房间利润',
  `time_string` varchar(32) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '时间字符串',
  `rebate_value` float(20,2) NOT NULL DEFAULT '0.00' COMMENT '用户房间流水',
  `total_amount` float(20,2) NOT NULL DEFAULT '0.00' COMMENT '总消费金额',
