  `return_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '返还时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

